const InfoAuthModal = ({ authInfoModal }) => {
  const styleObj = {
    position: 'absolute',
    top: '-10%',
    left: '50%',
    transform: 'translateX(-50%)',
    display: authInfoModal.modal ? 'block' : 'none',
  }

  console.log(authInfoModal)
  return <div style={styleObj}>{authInfoModal.text}</div>
}

export default InfoAuthModal
